import React from "react";
import { Modal as BModal, Button } from "react-bootstrap";
export default function Modal(props) {
  return (
    <BModal show={props.activeModal} onHide={props.handleModal(false)}>
      <BModal.Title>{props.title || "Form Title"} </BModal.Title>
      <BModal.Body>{props.children}</BModal.Body>
      <BModal.Footer>
        <Button variant="secondary" onClick={props.handleModal(false)}>
          {props.closeButtonText || "Close"}
        </Button>
        {props.submitButton || null}
      </BModal.Footer>
    </BModal>
  );
}
